import React from "react";
import styles from "./Movie.module.css"

const combinedClasses = ["movie__category", "movie__average-green"].map(cls => styles[cls]).join(' ');

const Movie = () => {
    return (
        <div className={styles["movie"]}>
            <div className={styles["movie__cover-inner"]}>
                <img src="https://lumiere-a.akamaihd.net/v1/images/p_junglecruise_21740_v2_bb7f0ae4.jpeg" 
                alt="" className={styles["movie__cover"]} />
                <div>

                </div>
            </div>
            <div className={styles["movie__info"]}>
                <div className={styles["movie__title"]}> </div>
                <div className={combinedClasses}> </div>
            </div>
        </div>
    )
}

export default Movie
